import React, { useState, useEffect } from 'react';
import { Calendar, Clock, Users, Search, Filter, MoreHorizontal } from 'lucide-react';

const Reservations = () => {
  const [reservations, setReservations] = useState([]);
  const [filteredReservations, setFilteredReservations] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [statusFilter, setStatusFilter] = useState('all');
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Simulate loading reservations
    setTimeout(() => {
      const mockReservations = [
        {
          id: 1,
          customerName: 'John Smith',
          email: 'john@example.com',
          phone: '(555) 123-4567',
          partySize: 4,
          date: '2024-01-15',
          time: '19:00',
          status: 'confirmed',
          tableNumber: 'A12',
          specialRequests: 'Window seat preferred'
        },
        {
          id: 2,
          customerName: 'Sarah Johnson',
          email: 'sarah@example.com',
          phone: '(555) 234-5678',
          partySize: 2,
          date: '2024-01-15',
          time: '20:30',
          status: 'pending',
          tableNumber: 'B8',
          specialRequests: ''
        },
        {
          id: 3,
          customerName: 'Mike Davis',
          email: 'mike@example.com',
          phone: '(555) 345-6789',
          partySize: 6,
          date: '2024-01-16',
          time: '18:00',
          status: 'confirmed',
          tableNumber: 'C15',
          specialRequests: 'Birthday celebration'
        },
        {
          id: 4,
          customerName: 'Emily Wilson',
          email: 'emily@example.com',
          phone: '(555) 456-7890',
          partySize: 3,
          date: '2024-01-16',
          time: '19:30',
          status: 'cancelled',
          tableNumber: 'A5',
          specialRequests: ''
        }
      ];
      
      setReservations(mockReservations);
      setFilteredReservations(mockReservations);
      setIsLoading(false);
    }, 1000);
  }, []);

  useEffect(() => {
    let filtered = reservations;

    // Apply search filter
    if (searchTerm) {
      filtered = filtered.filter(reservation =>
        reservation.customerName.toLowerCase().includes(searchTerm.toLowerCase()) ||
        reservation.email.toLowerCase().includes(searchTerm.toLowerCase()) ||
        reservation.phone.includes(searchTerm)
      );
    }

    // Apply status filter
    if (statusFilter !== 'all') {
      filtered = filtered.filter(reservation => reservation.status === statusFilter);
    }

    setFilteredReservations(filtered);
  }, [reservations, searchTerm, statusFilter]);

  const getStatusColor = (status) => {
    switch (status) {
      case 'confirmed':
        return 'bg-green-100 text-green-800';
      case 'pending':
        return 'bg-yellow-100 text-yellow-800';
      case 'cancelled':
        return 'bg-red-100 text-red-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('en-US', {
      weekday: 'short',
      month: 'short',
      day: 'numeric'
    });
  };

  if (isLoading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      <div className="flex justify-between items-center">
        <div>
          <h1 className="text-3xl font-bold text-gray-900">My Reservations</h1>
          <p className="text-gray-600">View and manage your restaurant reservations</p>
        </div>
        <div className="text-sm text-gray-500">
          Total: {filteredReservations.length} reservations
        </div>
      </div>

      {/* Filters and Search */}
      <div className="card">
        <div className="flex flex-col md:flex-row gap-4">
          <div className="flex-1">
            <div className="relative">
              <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400 w-4 h-4" />
              <input
                type="text"
                placeholder="Search by name, email, or phone..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="input-field pl-10"
              />
            </div>
          </div>
          <div className="flex gap-2">
            <select
              value={statusFilter}
              onChange={(e) => setStatusFilter(e.target.value)}
              className="input-field"
            >
              <option value="all">All Status</option>
              <option value="confirmed">Confirmed</option>
              <option value="pending">Pending</option>
              <option value="cancelled">Cancelled</option>
            </select>
            <button className="btn-secondary flex items-center">
              <Filter className="w-4 h-4 mr-2" />
              More Filters
            </button>
          </div>
        </div>
      </div>

      {/* Reservations List */}
      <div className="space-y-4">
        {filteredReservations.length === 0 ? (
          <div className="card text-center py-12">
            <Calendar className="w-12 h-12 text-gray-400 mx-auto mb-4" />
            <h3 className="text-lg font-medium text-gray-900 mb-2">No reservations found</h3>
            <p className="text-gray-600">
              {searchTerm || statusFilter !== 'all' 
                ? 'Try adjusting your search or filter criteria'
                : 'You don\'t have any reservations yet'
              }
            </p>
          </div>
        ) : (
          filteredReservations.map((reservation) => (
            <div key={reservation.id} className="card hover:shadow-md transition-shadow">
              <div className="flex flex-col lg:flex-row lg:items-center justify-between gap-4">
                {/* Reservation Details */}
                <div className="flex-1">
                  <div className="flex items-start justify-between mb-3">
                    <div>
                      <h3 className="text-lg font-semibold text-gray-900">
                        {reservation.customerName}
                      </h3>
                      <p className="text-gray-600">{reservation.email}</p>
                      <p className="text-gray-600">{reservation.phone}</p>
                    </div>
                    <span className={`inline-flex px-3 py-1 text-sm font-medium rounded-full ${getStatusColor(reservation.status)}`}>
                      {reservation.status}
                    </span>
                  </div>

                  <div className="grid grid-cols-2 md:grid-cols-4 gap-4 text-sm">
                    <div className="flex items-center text-gray-600">
                      <Calendar className="w-4 h-4 mr-2" />
                      <span>{formatDate(reservation.date)}</span>
                    </div>
                    <div className="flex items-center text-gray-600">
                      <Clock className="w-4 h-4 mr-2" />
                      <span>{reservation.time}</span>
                    </div>
                    <div className="flex items-center text-gray-600">
                      <Users className="w-4 h-4 mr-2" />
                      <span>{reservation.partySize} people</span>
                    </div>
                    <div className="text-gray-600">
                      Table {reservation.tableNumber}
                    </div>
                  </div>

                  {reservation.specialRequests && (
                    <div className="mt-3 pt-3 border-t border-gray-200">
                      <p className="text-sm text-gray-600">
                        <span className="font-medium">Special Requests:</span> {reservation.specialRequests}
                      </p>
                    </div>
                  )}
                </div>

                {/* Actions */}
                <div className="flex items-center gap-2">
                  <button className="btn-secondary text-sm">
                    Edit
                  </button>
                  <button className="btn-primary text-sm">
                    View Details
                  </button>
                  <button className="p-2 text-gray-400 hover:text-gray-600">
                    <MoreHorizontal className="w-4 h-4" />
                  </button>
                </div>
              </div>
            </div>
          ))
        )}
      </div>

      {/* Quick Stats */}
      <div className="grid md:grid-cols-3 gap-6">
        <div className="card text-center">
          <div className="text-2xl font-bold text-green-600 mb-1">
            {reservations.filter(r => r.status === 'confirmed').length}
          </div>
          <div className="text-sm text-gray-600">Confirmed</div>
        </div>
        <div className="card text-center">
          <div className="text-2xl font-bold text-yellow-600 mb-1">
            {reservations.filter(r => r.status === 'pending').length}
          </div>
          <div className="text-sm text-gray-600">Pending</div>
        </div>
        <div className="card text-center">
          <div className="text-2xl font-bold text-red-600 mb-1">
            {reservations.filter(r => r.status === 'cancelled').length}
          </div>
          <div className="text-sm text-gray-600">Cancelled</div>
        </div>
      </div>
    </div>
  );
};

export default Reservations;
